<title>Rellenador IMSS v2 ‚Äî P√°gina 2 final</title>
<style>
:root{ --page-w: 216mm; --page-h: 279mm; --accent:#2563eb; --muted:#93c5fd33; }
*{box-sizing:border-box}
body{margin:0;background:#0f172a;color:#e5e7eb;font-family:system-ui,-apple-system,Segoe UI,Roboto,Ubuntu,Cantarell,Noto Sans,Arial}
header{position:sticky;top:0;z-index:10;display:flex;gap:8px;align-items:center;padding:10px;background:#111827;border-bottom:1px solid #1f2937;flex-wrap:wrap}
header h1{font-size:15px;margin:0 10px 0 0}
.btn{background:#1f2937;color:#e5e7eb;border:1px solid #334155;padding:7px 10px;border-radius:10px;cursor:pointer}
.btn.primary{background:var(--accent);border-color:var(--accent);color:white}
select,input[type="text"]{background:#0b1220;color:#e5e7eb;border:1px solid #334155;border-radius:10px;padding:6px 8px}
main{display:grid;grid-template-columns:1fr 360px;gap:8px;padding:8px 10px 20px}
.page-wrap{position:relative;width:var(--page-w);height:var(--page-h);margin:auto}
.page{position:relative;width:100%;height:100%;background:#0b1220;border-radius:12px;overflow:hidden;box-shadow:0 10px 30px rgba(0,0,0,.35)}
.bg{position:absolute;inset:0;width:100%;height:100%;object-fit:contain}
.field{position:absolute;min-width:80px;min-height:18px;border:1px dashed var(--muted);border-radius:4px;padding:1px 4px;background:transparent;cursor:move;display:flex;align-items:center}
body.filling .field{border-color:transparent;cursor:text}
.t{width:100%;min-height:16px;outline:none;color:#2563eb} /* azul */
.meta{position:absolute;left:-6px;top:50%;transform:translate(-100%,-50%);font-size:10px;color:#93c5fd;opacity:.95;white-space:nowrap;background:transparent;padding:0 4px}
.del{position:absolute;right:-6px;top:-6px;font-size:11px;background:#7f1d1d;border:1px solid #991b1b;color:white;border-radius:8px;padding:0 6px;display:none;cursor:pointer}
body.editing .del{display:block}
aside{background:#0b1220;border:1px solid #334155;border-radius:12px;padding:10px;position:sticky;top:64px;height:max(60vh,420px)}
aside h3{margin:4px 0 8px;font-size:14px}
.formlist{display:flex;flex-direction:column;gap:8px;max-height:55vh;overflow:auto}
.row{display:grid;grid-template-columns:1fr auto;gap:6px;align-items:center}
.row label{font-size:11px;color:#cbd5e1}
.row input{background:#0a1120;color:#e5e7eb;border:1px solid #334155;border-radius:8px;padding:6px 8px}
.row .trash{background:#7f1d1d;border:1px solid #991b1b;color:white;border-radius:8px;padding:6px 8px;cursor:pointer}
.hint{font-size:12px;color:#cbd5e1;margin-top:6px}
@media print{ header,aside,.meta,.del{display:none!important} body{background:white} main{grid-template-columns:1fr;padding:0} .page-wrap{box-shadow:none;border-radius:0} }
</style>
</head>

  fieldsByPage: {
    0: ["OOAD", "Secci\u00f3n sindical", "A_Nombre", "A_Matricula", "A_Adscripci\u00f3n", "A_Categor\u00eda", "A_Turno", "A_Jornada", "A_Horario", "A_Descanso", "B_Nombre", "B_Matricula", "B_Adscripci\u00f3n", "B_Categor\u00eda", "B_Turno", "B_Jornada", "B_Horario", "B_Descanso", "B_Horariosust", "B_FechaTXT"],
    1: ["Lugar", "Categor\u00eda", "X", "D\u00eda", "Mes", "A\u00f1o", "D\u00eda 2", "Mes 2", "A\u00f1o 2", "X2", "Matr\u00edcula", "Turno", "TotalDias", "Adscripcion", "Apaterno", "Amamterno", "Nombre"]
  }
};
function save(state){ localStorage.setItem(STORAGE_KEY, JSON.stringify(state)); }
function load(){ try{ return JSON.parse(localStorage.getItem(STORAGE_KEY)) || null; }catch{ return null; } }
const DEFAULT_WIDTH = 220;
const DEFAULT_FONT = 11;
let state = (function(){
  const st = load();
  if(st && st.pages && Array.isArray(st.pages)){ return st; }
  const fresh = { mode:'fill', pageIndex:0, pages:[{bg:EMBED.pages[0].bg, fields:[]}, {bg:EMBED.pages[1].bg, fields:[]}] };
  Object.entries(EMBED.fieldsByPage).forEach(([idx, arr])=>{
    const pageIdx = parseInt(idx);
    arr.forEach((name,i)=>{
      fresh.pages[pageIdx].fields.push({ id: Math.random().toString(36).slice(-6), name, x: 24, y: 24 + i*22, w: DEFAULT_WIDTH, fontSize: DEFAULT_FONT, text:'' });
    });
  });
  save(fresh);
  return fresh;
})();
// DOM
const page = document.getElementById('page');
const bg = document.getElementById('bg');
const pnum = document.getElementById('pnum');
const pageSel = document.getElementById('pageSel');
const formlist = document.getElementById('formlist');
function setMode(mode){
  state.mode = mode;
  document.body.classList.toggle('filling', mode==='fill');
  document.body.classList.toggle('editing', mode==='edit');
  save(state);
}
function renderBG(){
  bg.src = state.pages[state.pageIndex].bg || '';
  pnum.textContent = String(state.pageIndex + 1);
  pageSel.value = String(state.pageIndex);
}
function createFieldEl(f){
  const el = document.createElement('div'); el.className='field'; el.dataset.id=f.id;
  el.style.left = f.x + 'px'; el.style.top = f.y + 'px'; el.style.width = (f.w||DEFAULT_WIDTH) + 'px';
  el.style.fontSize = (f.fontSize||DEFAULT_FONT) + 'px';
  const meta = document.createElement('div'); meta.className='meta'; meta.textContent = f.name; el.appendChild(meta);
  const t = document.createElement('div'); t.className='t'; t.contentEditable = true; t.innerText = f.text||''; el.appendChild(t);
  const del = document.createElement('button'); del.className='del'; del.textContent='‚úï'; del.title='Eliminar'; el.appendChild(del);
  del.addEventListener('click', (e)=>{
    e.stopPropagation();
    const list = state.pages[state.pageIndex].fields;
    const idx = list.findIndex(ff=>ff.id===f.id);
    if(idx>=0){ list.splice(idx,1); el.remove(); renderForm(); save(state); }
  });
  let drag=false,sx=0,sy=0,bx=0,by=0;
  el.addEventListener('mousedown', e=>{ if(state.mode!=='edit') return; drag=true;sx=e.clientX;sy=e.clientY;bx=f.x;by=f.y;e.preventDefault(); });
  window.addEventListener('mousemove', e=>{ if(!drag) return; const dx=e.clientX-sx, dy=e.clientY-sy; f.x=bx+dx; f.y=by+dy; el.style.left=f.x+'px'; el.style.top=f.y+'px'; });
  window.addEventListener('mouseup', ()=>{ if(drag){ drag=false; save(state); } });
  el.addEventListener('wheel', e=>{ if(state.mode!=='edit'||!e.altKey) return; e.preventDefault(); f.w=Math.max(80,(f.w||DEFAULT_WIDTH)+(e.deltaY<0?10:-10)); el.style.width=f.w+'px'; save(state); }, {passive:false});
  t.addEventListener('input', ()=>{ f.text=t.innerText; const inp=document.querySelector('input[data-id="'+f.id+'"]'); if(inp) inp.value=f.text; save(state); });
  return el;
}
function renderFields(){
  Array.from(page.querySelectorAll('.field')).forEach(n=>n.remove());
  const fields = state.pages[state.pageIndex].fields;
  fields.forEach(f=> page.appendChild(createFieldEl(f)) );
  renderForm();
}
function renderForm(){
  formlist.innerHTML = '';
  const fields = state.pages[state.pageIndex].fields;
  fields.forEach(f=> {
    const row = document.createElement('div'); row.className='row';
    const label = document.createElement('label'); label.textContent = f.name;
    const input = document.createElement('input'); input.type='text'; input.value=f.text||''; input.dataset.id=f.id;
    const trash = document.createElement('button'); trash.className='trash'; trash.textContent='‚úï';
    input.addEventListener('input', ()=>{ f.text=input.value; const el = page.querySelector('.field[data-id="'+f.id+'"] .t'); if(el) el.innerText=f.text; save(state); });
    trash.addEventListener('click', ()=>{ const list = state.pages[state.pageIndex].fields; const idx = list.findIndex(ff=>ff.id===f.id); if(idx>=0){ list.splice(idx,1); renderFields(); save(state); } });
    row.appendChild(label); row.appendChild(input); row.appendChild(trash); formlist.appendChild(row);
  });
}
pageSel.addEventListener('change', ()=>{ state.pageIndex = parseInt(pageSel.value,10)||0; renderBG(); renderFields(); save(state); });
document.getElementById('btnMode').addEventListener('click', ()=> setMode(state.mode==='edit'?'fill':'edit'));
document.getElementById('btnPrint').addEventListener('click', ()=>{ if(state.mode==='edit') setMode('fill'); setTimeout(()=>window.print(),30); });
document.getElementById('btnExport').addEventListener('click', ()=>{ const payload = JSON.stringify(state, null, 2); const a = document.createElement('a'); a.href = URL.createObjectURL(new Blob([payload], {type:'application/json'})); a.download='dise√±o_imss_v2_p2final.json'; a.click(); URL.revokeObjectURL(a.href); });
document.getElementById('importDesign').addEventListener('change', async (e)=>{ const f=e.target.files?.[0]; if(!f) return; try{ const txt=await f.text(); const data=JSON.parse(txt); if(!data||!data.pages) throw new Error('Archivo inv√°lido'); state=data; renderBG(); renderFields(); save(state);} catch(err){ alert('No se pudo importar: '+err.message); } e.target.value=''; });
document.getElementById('btnReset').addEventListener('click', ()=>{ if(confirm('Esto borrar√° el dise√±o guardado en este navegador. ¬øContinuar?')){ localStorage.removeItem(STORAGE_KEY); location.reload(); } });
setMode(state.mode||'fill');
renderBG();
